function Login() {
    const [email, setEmail] = useState('');

    return (
        <div className="login-container">
            <form className="form">
                <input type="email" placeholder="Email" name="email" id="email" onChange={(e) => setEmail(e.target.value)} />
            </form>
        </div>

    );
}

export default Login;
